import React, { useState, useEffect } from 'react';
import axios from '../utils/axios';
import {
  Box,
  TextField,
  Button,
  Card,
  CardContent,
  Typography,
  Grid,
  CircularProgress,
  Link,
  Chip,
  Stack,
  Tabs,
  Tab,
} from '@mui/material';

const ExternalSearch = () => {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [tabValue, setTabValue] = useState(0);

  const handleSearch = async (e) => {
    e.preventDefault();
    if (!query.trim()) return;

    setLoading(true);
    setError(null);

    try {
      const response = await axios.get(`/api/search/external?q=${encodeURIComponent(query)}`);
      setResults(response.data.items);
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to fetch results');
    } finally {
      setLoading(false);
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'long',
      day: 'numeric',
    });
  };

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  const renderResult = (item) => {
    if (item.source === 'arxiv') {
      return (
        <Card key={item.id}>
          <CardContent>
            <Typography variant="h6" gutterBottom>
              <Link
                href={item.url}
                target="_blank"
                rel="noopener noreferrer"
                underline="hover"
              >
                {item.title}
              </Link>
            </Typography>

            <Typography variant="body2" color="text.secondary" paragraph>
              {item.description}
            </Typography>

            <Stack direction="row" spacing={1} alignItems="center">
              <Chip
                label="arXiv"
                size="small"
                color="primary"
                variant="outlined"
              />
              <Typography variant="caption" color="text.secondary">
                Published: {formatDate(item.published)}
              </Typography>
            </Stack>
          </CardContent>
        </Card>
      );
    }
    // Add GitHub result rendering here when implemented
    return null;
  };

  return (
    <Box sx={{ py: 4 }}>
      <form onSubmit={handleSearch}>
        <Stack direction="row" spacing={2} sx={{ mb: 4 }}>
          <TextField
            fullWidth
            label="Search external sources"
            variant="outlined"
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            placeholder="Search arXiv papers and GitHub repositories..."
          />
          <Button
            type="submit"
            variant="contained"
            disabled={loading}
            sx={{ minWidth: 120 }}
          >
            {loading ? <CircularProgress size={24} /> : 'Search'}
          </Button>
        </Stack>
      </form>

      {error && (
        <Typography color="error" sx={{ mb: 2 }}>
          {error}
        </Typography>
      )}

      <Tabs
        value={tabValue}
        onChange={handleTabChange}
        sx={{ mb: 3 }}
      >
        <Tab label="All Results" />
        <Tab label="arXiv Papers" />
        <Tab label="GitHub Repositories" />
      </Tabs>

      <Grid container spacing={3}>
        {results
          .filter(item => {
            if (tabValue === 0) return true;
            if (tabValue === 1) return item.source === 'arxiv';
            if (tabValue === 2) return item.source === 'github';
            return true;
          })
          .map(renderResult)}
      </Grid>

      {!loading && results.length === 0 && !error && (
        <Typography variant="body1" color="text.secondary" align="center">
          No results found. Try a different search query.
        </Typography>
      )}
    </Box>
  );
};

export default ExternalSearch;
